/* Procedure structure for procedure `proc_absentstudents` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_absentstudents` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_absentstudents`()
BEGIN
	SELECT id FROM ay_students a
	WHERE a.isExempted = 0 and id NOT IN 
	(
		SELECT id FROM attlog 
		WHERE academicYearID=(SELECT academicYearID FROM academicyear WHERE active=1 AND DATE(datetimeLog) = CURDATE()
		)
	);
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_attendance_student` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_attendance_student` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_attendance_student`(vid int, vayid int, vfrom date, vto date)
BEGIN
    
    SELECT
table1.gen_date,
vid as user_id,
(SELECT CASE WHEN TIME(datetimeLog) BETWEEN '06:00:00' AND '7:31:00' THEN concat('IN ', time_format(time(datetimeLog), '%h:%i %p')) ELSE CONCAT('IN(LATE) ', TIME_FORMAT(TIME(datetimeLog), '%h:%i %p')) END FROM attlog WHERE attlog.`id` = vid AND TIME(datetimeLog) BETWEEN '6:00:00' AND '08:31:00' AND remarks = 'IN' AND DATE(datetimeLog) = table1.gen_date and attlog.`academicyearID` = vayid order by time(datetimeLog) desc limit 1) AS timeInAM,
(SELECT concat(remarks," ", time_format(datetimeLog, '%h:%i %p')) FROM attlog WHERE attlog.`id` = vid AND TIME(datetimeLog) BETWEEN '11:00:00' AND '13:00:00' AND remarks = 'OUT' AND DATE(datetimeLog) = table1.gen_date and attlog.`academicyearID` = vayid ORDER BY TIME(datetimeLog) DESC LIMIT 1) AS timeOutAM,
(SELECT CASE WHEN TIME(datetimeLog) BETWEEN '12:00:00' AND '13:16:00' THEN CONCAT('IN ', TIME_FORMAT(TIME(datetimeLog), '%h:%i %p')) ELSE CONCAT('IN(LATE) ', TIME_FORMAT(TIME(datetimeLog), '%h:%i %p')) END FROM attlog WHERE attlog.`id` = vid AND TIME(datetimeLog) BETWEEN '12:30:00' AND '13:30:00' AND remarks = 'IN' AND DATE(datetimeLog) = table1.gen_date and attlog.`academicyearID` = vayid ORDER BY TIME(datetimeLog) DESC LIMIT 1) AS timeInPM,
(SELECT CONCAT(remarks," ", TIME_FORMAT(datetimeLog, '%h:%i %p')) FROM attlog WHERE attlog.`id` = vid AND TIME(datetimeLog) BETWEEN '16:30:00' AND '23:59:00' AND remarks = 'OUT' AND DATE(datetimeLog) = table1.gen_date and attlog.`academicyearID` = vayid ORDER BY TIME(datetimeLog) DESC LIMIT 1) AS timeOutPM,
(select lname from student where id=vid) as lname,
(SELECT fname FROM student WHERE id=vid) as fname,
(SELECT mname FROM student WHERE id=vid) as mname
 FROM 
(
SELECT * FROM 
(SELECT ADDDATE('1970-01-01',t4*10000 + t3*1000 + t2*100 + t1*10 + t0) gen_date FROM
 (SELECT 0 t0 UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4 UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9) t0,
 (SELECT 0 t1 UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4 UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9) t1,
 (SELECT 0 t2 UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4 UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9) t2,
 (SELECT 0 t3 UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4 UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9) t3,
 (SELECT 0 t4 UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4 UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9) t4) v
 
WHERE gen_date BETWEEN vfrom AND vto) AS table1;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_attmonitoring` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_attmonitoring` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_attmonitoring`(vgrade varchar(30), vsection varchar(30), vaycode varchar(30), vdatefrom date, vdateto date)
BEGIN
SELECT 
a.attlogID , a.id, c.studentID, c.lname, c.fname, c.mname,
c.rfid, c.lrn, c.mobileNo,
a.datetimeLog,
DATE(a.datetimeLog)AS dateLog,
a.remarks,
a.timeSent,
a.isSent,
a.academicyearID,
d.ayCode, d.ayDesc,
e.grade, f.section,
users.userID, users.lname AS 't_lname',
users.fname AS 't_fname',
users.mname AS 't_mname'
FROM attlog a JOIN ay_students b ON a.id =b.id
JOIN student c ON b.id = c.id
JOIN academicyear d ON a.academicyearID = d.academicyearID
JOIN grades e ON b.gradeID = e.gradeID
JOIN sections f ON b.sectionID = f.sectionID
JOIN rooms_teacher ON b.gradeID = rooms_teacher.gradeID AND b.sectionID = rooms_teacher.sectionID AND a.academicyearID = rooms_teacher.academicyearID
JOIN users ON rooms_teacher.teacherID = users.userID
where
	e.grade like concat(vgrade, '%') and
	f.section LIKE CONCAT(vsection, '%') and
	d.ayCode LIKE CONCAT(vaycode, '%') and
	date(a.datetimeLog) between vdatefrom and vdateto;
    
END */$$
DELIMITER ;

